import React from 'react';
import AppMode from "./../AppMode.js";

class MainPage extends React.Component {
    ChangeModeRounds = () =>{
      this.props.changeMode(AppMode.ROUNDS)
    }
    ChangeModeFee = () =>{
      this.props.changeMode(AppMode.ROUNDS)
    }
    ChangeModeService = () =>{
      this.props.changeMode(AppMode.ROUNDS)
    }
    ChangeModeInfo = () =>{
      this.props.changeMode(AppMode.INFOPAGE)
    }

    render() {
      return(
        <div>
            <center>
            <div style={{marginTop: '10%'}}>
                <h1>Welcome to SKS-SPS parking system</h1>
                <h2>To access following service, please click on related button</h2>
              </div>
            </center>
            <div style={{marginTop: '10%'}}>
              <center>
              <button onClick = {this.ChangeModeInfo}>Parking Information</button>
                <button style={{maringLeft: '5px'}} onClick = {this.ChangeModeRounds}>Make Reservation</button>
                <button style={{maringLeft: '5px'}} onClick = {this.ChangeModeFee}>Pay Parking Fee</button>
                <button style={{maringLeft: '5px'}} onClick = {this.ChangeModeService}>Customer Service</button>
              </center>
            </div>
        </div>
      );
    }
}

export default MainPage;
